\t<section class=\"hero-registration\">
\t\t<div class=\"hero-degradation\">
\t\t\t<div class=\"panel\">
\t\t\t\t<div class=\"form-wrapper\">
\t\t\t\t\t<form method=\"post\" class=\"form panel__login-form\" id=\"login-form\">
\t\t\t\t\t\t{% if error %}
\t\t\t\t\t\t\t<div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
\t\t\t\t\t\t{% endif %}

\t\t\t\t\t\t{% if app.user %}
\t\t\t\t\t\t\t<div class=\"mb-3\">
\t\t\t\t\t\t\t\tYou are logged in as
\t\t\t\t\t\t\t\t{{ app.user.userIdentifier }},
\t\t\t\t\t\t\t\t<a href=\"{{ path('app_logout') }}\">Logout</a>
\t\t\t\t\t\t\t</div>
\t\t\t\t\t\t{% endif %}
\t\t\t\t\t\t<div class=\"form__row\">
\t\t\t\t\t\t\t<input type=\"email\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control form__input\" autocomplete=\"email\" required autofocus>
\t\t\t\t\t\t\t<label for=\"inputEmail\" class=\"form__label\">Email</label>
\t\t\t\t\t\t</div>
\t\t\t\t\t\t<div class=\"form__row\">
\t\t\t\t\t\t\t<input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control form__input\" autocomplete=\"current-password\" required>
\t\t\t\t\t\t\t<label for=\"inputPassword\" class=\"form__label\">Password</label>
\t\t\t\t\t\t</div>
\t\t\t\t\t\t<div class=\"form__row\">
\t\t\t\t\t\t\t<input type=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token('authenticate') }}\">
\t\t\t\t\t\t\t<button class=\"btn btn-lg btn-primary form__submit\" type=\"submit\">
\t\t\t\t\t\t\t\tMe Connecter
\t\t\t\t\t\t\t</button>
\t\t\t\t\t\t</div>
\t\t\t\t\t</form>
\t\t\t\t</div>
\t\t\t</div>
